      const Lastname1 = generateShortUniqueName();
      _Bookingclient.default.Addclientbutton.invoke('show').click();
      _Bookingclient.default.Newclientheader.should('be.visible');
      _Bookingclient.default.Createclient.should('be.disabled');
      _Bookingclient.default.firstname.click();
      _Bookingclient.default.lastname.click();
      _Bookingclient.default.errormsg.should('be.visible');
      _Bookingclient.default.firstname.type(Firstname1);
      _Bookingclient.default.lastname.click();
      _Bookingclient.default.errormsg.should('be.visible');
      _Bookingclient.default.lastname.type(Lastname1);
      _Bookingclient.default.personalmail.type(dataJson.Personalemail);
      cy.wait(1000);
      _Bookingclient.default.Createclient.should('be.enabled').click();
    } else {
      cy.log('No matching buttons found.');
    }
  });
});

