});
cy.viewport(1500, 785);
cy.wait(6000);
_Booking.default.Cancel.click();
cy.wait(5000);
const Link = 'a[href="https://advisor.fora.travel/help/articles/what-will-my-clients-see-when-i-send-a-review-request"]';
cy.fixture('Advisor_Bookings_Travel Review_TS001.json').then(function (dataJson) {
  _Bookingclient.default.Text.invoke('text').then(text => {
    if (text.includes('Completed')) {
      _Bookingclient.default.Hotel.should('be.visible').then(() => {
        _Bookingclient.default.Travelreview.eq(0).scrollIntoView().should('be.visible').then($element => {
          const elementText = $element.text();
          if (elementText.includes('Request Travel Review')) {
            cy.get($element).contains('Request Travel Review').click({
              force: true
            });
            _Bookingclient.default.Requetreviewtext.should('be.visible');
            _Bookingclient.default.subtext.should('be.visible');
            _Bookingclient.default.suppliercheckbox.should('be.checked');
            _Bookingclient.default.Traveladvisor.should('be.visible');
            _Bookingclient.default.Traveladvisorcheckbox.uncheck();
            _Bookingclient.default.Traveladvisorcheckbox.check();
            _Bookingclient.default.subtext.should('be.visible');
            _Bookingclient.default.Learnaboutclientlink.click();
            cy.get(Link).should('have.attr', 'href').then(href => {
              cy.request({
                url: href,
                failOnStatusCode: false
              }).then(response => {
                if (response.status !== 200) {
                  cy.log(`Broken link found: ${href}`);
                }
              });
            });
            _Bookingclient.default.Clientemail.should('be.visible');
            cy.get('.react-select__input-container').click();
            cy.wait(2000);
            _Bookingclient.default.Selectemail.type(dataJson.Mail, {
              timeout: 2000
            });
            cy.wait(8000);
            _Bookingclient.default.result.invoke('show').click();
            _Bookingclient.default.Addpersonalmsg.type(dataJson.Personalmsg);
            _Bookingclient.default.savebutton.click();
            cy.wait(2000);
          } else if (elementText.includes('Travel Review Requested')) {
            cy.log('Travel Review Requested message found.');
          } else {
            cy.log('No review request button or message available.');
          }
        });
      });
    } else if (text.includes('Booked')) {
      cy.log('No travel review available');
    } else if (text.includes('Completed')) {
      _Bookingclient.default.Cruise.should('be.visible');
      _Bookingclient.default.Travelreview.should('be.visible').then($element => {
        const elementText = $element.text();
        if (elementText.includes('Request Travel Review')) {
          cy.get($element).contains('Request Travel Review').click({
            force: true
          });
          _Bookingclient.default.Requetreviewtext.should('be.visible');
          _Bookingclient.default.subtext.should('be.visible');
          _Bookingclient.default.suppliercheckbox.should('be.checked');
          _Bookingclient.default.Traveladvisor.should('be.visible');
          _Bookingclient.default.Traveladvisorcheckbox.uncheck();
          _Bookingclient.default.Traveladvisor.should('be.visible');
          _Bookingclient.default.Traveladvisorcheckbox.uncheck();
          _Bookingclient.default.Traveladvisorcheckbox.check();
          _Bookingclient.default.Learnaboutclientlink.click();
          cy.get(Link).should('have.attr', 'href').then(href => {
            cy.request({
              url: href,
              failOnStatusCode: false
            }).then(response => {
              if (response.status !== 200) {
                cy.log(`Broken link found: ${href}`);
              }
            });
          });
          _Bookingclient.default.Clientemail.should('be.visible');
          cy.wait(2000);
          _Bookingclient.default.Selectemail.type(dataJson.Mail, {
            timeout: 2000
          });
          //  Bookingclient.result.click()
          _Bookingclient.default.Addpersonalmsg.type("Client");
          _Bookingclient.default.savebutton.click();
          cy.wait(2000);
        } else if (elementText.includes('Travel Review Requested')) {
          cy.log('Travel Review Requested message found.');
        } else {
          cy.log('No review request button or message available.');
        }
      });
    }
  });
});

